pragma solidity ^0.7.1;
//SPDX-License-Identifier: UNLICENSED
import "../Interfaces/ITrustAnchorAttestation.sol";
import "../Interfaces/ITrustChannelRules.sol";

interface ITrustChannelManager is ITrustAnchorAttestation, ITrustChannelRules {
    function isTrustChannelAdministrator(address _trustChannelAdministratorAddress, address _trustChannelAddress) external view returns (bool result);
    function getTrustChannelAdministratorForTrustChannelByIndex(address _trustChannelAddress, uint64 _index) external view returns (address result);

    function getTrustChannelLowestSubmapNumberForTrustAnchorIndex(uint32 _trustAnchorIndex) external view returns (uint24 result);
    function getTrustChannelHighestSubmapNumberForTrustAnchorIndex(uint32 _trustAnchorIndex) external view returns (uint24 result);
    function getTrustChannelIndexBitFieldAtSubmapNumberForTrustAnchorIndex(uint32 _trustAnchorIndex, uint24 submapNumber) external view returns (uint256 result);

    function setTrustChannelRuleActive(address _trustChannelAddress, uint8 _ruleIndex, bool _active) external returns (uint8 result);
    function setTrustChannelRulesStorage(address _trustChannelAddress, uint8 _ruleIndex, uint8 _ruleStorageSubindex, bytes32 _newValue) external returns (uint8 result);
    function getTrustChannelRulesStorage(address _trustChannelAddress, uint8 _ruleIndex, uint8 _ruleStorageSubindex) external view returns (bytes32 result);
    function getTrustChannelRulesStorage(uint32 _trustChannelIndex, uint8 _ruleIndex, uint8 _ruleStorageSubindex) external view returns (bytes32 result);

    function getActiveChannelRulesBitField(uint32 _trustChannelIndex) external view returns (uint8 result, uint256 foundChannelRulesBitField);

    function getTrustChannelIndexFromTrustChannelKeccak(bytes32 _trustChannelKeccak) external view returns (uint32 result);
    function getTrustChannelKeccakFromTrustChannelIndex(uint32 _trustChannelIndex) external view returns (bytes32 result);

    function getNumberOfTrustAnchorsForTrustChannel(address _trustChannelAddress) external view returns (uint256 result);
    function getTrustAnchorForTrustChannelByArrayIndex(address _trustChannelAddress, uint256 _arrayIndex) external view returns (address result);
    function getAllTrustAnchorsForTrustChannel(address _trustChannelAddress) external view returns (address[] memory result);
}
